import React from 'react';
import { ProjectsList } from '../helpers/ProjectsList}';

function Projects() {
    return (
        <div className="projects">
            <h1 className="projectsTitle">My Projects</h1>
            <div className="projectsList">{ProjectsList}</div>
        </div>

    );
}

export default Projects;
